    function new_country() {
      var n = countries.length
      var i = parseInt(Math.random() * n)
      country = countries[i]
      console.log(i, country, n, countries.length)
      series = travel[i]
      series[i][1] = 0

      var dom = document.getElementById('country')
      dom.innerHTML = country.name

      // Datamaps expect data in format:

      // { "USA": { "fillColor": "#42a844", numberOfWhatever: 75},
      //   "FRA": { "fillColor": "#8dc386", numberOfWhatever: 43 } }
      var dataset = {};

      // We need to colorize every country based on "numberOfWhatever"
      // colors should be uniq for every value.
      // For this purpose we create palette(using min/max series-value)
      var onlyValues = series.map(function(obj) {
        return obj[1];
      });
      var minValue = Math.min.apply(null, onlyValues);
      var maxValue = Math.max.apply(null, onlyValues);

      // create color palette function
      // color can be whatever you wish
      var paletteScale = d3.scale.linear()
        .domain([minValue, 0, maxValue])
        .range(["#6F3802", "#EEEEEE", "#02386F"]); // blue color

      // fill dataset in appropriate format
      series.forEach(function(item) { //
        // item example value ["USA", 70]
        var iso = item[0],
          value = item[1];
        dataset[iso] = {numberOfThings: value, fillColor: paletteScale(value)};
      });

      dataset[series[i][0]].fillColor = 'red'

      var el = document.getElementById('container1')
      el.remove()

      var newEl = document.createElement('div')
      newEl.setAttribute("id", "container1")
      document.body.appendChild(newEl)

      // render map

      var dataMap = new Datamap({
        element: document.getElementById('container1'),
        // big world map
        // projection: 'mercator',
        setProjection: function(element) {
          var projection = d3.geo.mercator()
            .center(country.coordinates) // always in [East Latitude, North Longitude]
            .scale(150)
            .translate([element.offsetWidth / 2, element.offsetHeight / 2])
          var path = d3.geo.path().projection(projection)
          return {path: path, projection: projection}
        },
        // countries don't listed in dataset will be painted with this color
        fills: {defaultFill: '#F5F5F5'},
        data: dataset,
        geographyConfig: {
          borderColor: '#DEDEDE',
          highlightBorderWidth: 2,
          // don't change color on mouse hover
          highlightFillColor: function(geo) {
            return geo['fillColor'] || '#F5F5F5';
          },
          // only change border
          highlightBorderColor: '#B7B7B7',
          // show desired information in tooltip
          popupTemplate: function(geo, data) {
            // don't show tooltip if country don't present in dataset
            if (!data) {
              return;
            }
            // tooltip content
            return ['<div class="hoverinfo">',
              '<strong>', geo.properties.name, '</strong>',
              '<br>Count: <strong>', data.numberOfThings, '</strong>',
              '</div>'].join('');
          }
        }
      });
    }

    new_country()
